(293, 69, '_et_pb_old_content', 'Proteína picante para los amantes del chile habanero y el garbanzo, 100% vegana con selección de vegetales y granos funcionales de máxima calidad. Sin conservantes, sin preservantes. Su alto contenido en fibra ayuda a combatir el estreñimiento, disminuir la posibilidad de sufrir enfermedades intestinales y saciar el apetito.\r\n\r\nEl chile habanero contiene altos niveles de capsaicina, el cual funciona como un antiinflamatorio natural que ayuda a tratar la artritis y los dolores de cabeza.\r\n\r\nPaquete x 3 unidades\r\n\r\n&nbsp;'),
