(322, 71, '_et_pb_old_content', 'Proteína hecha a base de una selección de granos como lentejas, soja y garbanzos 100% vegana con selección de vegetales y granos funcionales de máxima calidad. Sin conservantes, sin preservantes.\r\n\r\nLas lentejas son una gran fuente de hierro, manganeso, potasio, cobre, fósforo, zinc y en menor cantidad selenio y calcio.\r\n\r\nLa Soja también cuentan con vitaminas del grupo B, E, isoflavonas y minerales  como el calcio, hierro, potasio, zinc y fósforo.\r\n\r\nEl garbanzo tiene muchos minerales, sobre todo fósforo, hierro y magnesio; es especialmente rico en vitaminas B1, B6 y ácido fólico.'),
