(349, 72, '_et_pb_old_content', 'Proteína hecha de arveja + garbanzos 100% vegana con selección de vegetales y granos funcionales de máxima calidad. Sin conservantes, sin preservantes.\r\n\r\nLas arvejas son ricas en proteínas y carbohidratos, bajas en grasa y contribuyen una buena fuente de fibra, vitaminas A, B y C; cuando se consumen frescas o refrigeradas, suministran hierro y tiamina.\r\n\r\nPaquete x 3 unidades.'),
