_pb_line_break_holder] -->				clone.remove();<!-- [et_pb_line_break_holder] -->				item.clone().inject(drop);<!-- [et_pb_line_break_holder] -->				dropFx.start(\'7389AE\').chain(dropFx.start.pass(\'ffffff\', dropFx));<!-- [et_pb_line_break_holder] -->			},<!-- [et_pb_line_break_holder] -->			\'over\': function() {<!-- [et_pb_line_break_holder] -->				dropFx.start(\'98B5C1\');<!-- [et_pb_line_break_holder] -->			},<!-- [et_pb_line_break_holder] -->			\'leave\': function() {<!-- [et_pb_line_break_holder] -->				dropFx.start(\'ffffff\');<!-- [et_pb_line_break_holder] -->			}<!-- [et_pb_line_break_holder] -->		});<!-- [et_pb_line_break_holder] --> <!-- [et_pb_line_break_holder] -->		var drag = clone.makeDraggable({<!-- [et_pb_line_break_holder] -->			droppables: [drop]<!-- [et_pb_line_break_holder] -->		}); // this returns the dragged element<!-- [et_pb_line_break_holder] --> <!-- [et_pb_line_break_holder] -->		drag.start(e); // start the event manual<!-- [et_pb_line_break_holder] -->	});<!-- [et_pb_line_break_holder] --> <!-- [et_pb_line_break_holder] -->});<!-- [et_pb_line_break_holder] -->  </script>[/et_pb_code][/et_pb_column][/et_pb_row][/et_pb_section]', 'Mercados', '', 'inherit', 'closed', 'closed', '', '311-revision-v1', '', '', '2020-05-08 18:23:36', '2020-05-08 18:23:36', '', 311, 'https://www.greenmagicland.com/2020/05/08/311-revision-v1/', 0, 'revision', '', 0),
