INSERT INTO `gm_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'Nueva(s) característica(s)', '¡Bienvenido a la nueva experiencia de WooCommerce! ¡En esta nueva versión podrás echar un vistazo a cómo funciona tu tienda en el escritorio, gestionar aspectos importantes de tu negocio (como la gestión de pedidos, inventario, valoraciones) desde cualquier parte de la interfaz, navegar en los datos de tu tienda con una sección de análisis completamente nueva y más!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-29 16:28:58', NULL, 0),
(2, 'wc-admin-store-notice-setting-moved', 'info', 'en_US', '¿Estás buscando el ajuste de aviso en la tienda?', 'Ahora lo puedes encontrar en el personalizador.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-29 16:28:58', NULL, 0),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Conectar con WooCommerce.com', 'Conéctate para recibir avisos y actualizaciones importantes de productos.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-29 16:28:59', NULL, 0),
(4, 'wc-admin-add-first-product', 'info', 'en_US', 'Añade tu primer producto', 'Aumenta tus ingresos añadiendo productos a tu tienda. Añade productos manualmente, importa desde una hoja o migra desde otra plataforma.', 'product', '{}', 'unactioned', 'woocommerce-admin', '2020-04-29 16:29:00', NULL, 0),
(5, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicación móvil WooCommerce', 'Instala la aplicación móvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver métricas clave – allí donde estés.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2020-05-01 16:29:08', NULL, 0),
(6, 'wc-admin-store-notice-giving-feedback', 'info', 'en_US', 'Valora tu experiencia', '´Si te gusta WooCommerce Admin, por favor, déjanos una valoración de 5 estrellas. ¡Muchas gracias por adelantado!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-05-02 18:34:14', NULL, 0),
(7, 'wc-admin-facebook-extension', 'info', 'en_US', 'Vende en Facebook', 'Haz crecer tu negocio dirigiéndote a las personas adecuadas e impulsando las ventas con Facebook. Puedes instalar ahora esta extensión gratuita.', 'thumbs-up', '{}', 'actioned', 'woocommerce-admin', '2020-05-02 18:34:14', NULL, 0),
(8, 'wc-admin-orders-milestone', 'info', 'en_US', 'Primer pedido', '¡Enhorabuena por conseguir tu primer pedido de un cliente! Aprende cómo gestionar tus pedidos.', 'trophy', '{}', 'unactioned', 'woocommerce-admin', '2020-05-04 17:29:28', NULL, 0),
(9, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Trucos, actualizaciones de productos e inspiración', 'Estamos aquí por ti - consigue trucos, actualizaciones de productos e inspiración en tu buzón.', 'mail', '{}', 'unactioned', 'woocommerce-admin', '2020-05-08 16:48:05', NULL, 0);
